import {
  faSearch,
  faUser,
  faBars,
  faAngleDown,
  faCheck,
  faBolt,
  faLightbulb
} from "@fortawesome/free-solid-svg-icons";
import { library } from "@fortawesome/fontawesome-svg-core";
library.add(
  faSearch,
  faUser,
  faBars,
  faAngleDown,
  faCheck,
  faBolt,
  faLightbulb
);

export default library;
